import React from 'react';

function CartModal({ isOpen, onClose, children }) {
    if (!isOpen) {
        return null;
    }

    return (
        <div>
            <div>
                <button onClick={onClose}>Close</button>
            </div>
            <div>
                {children}
            </div>
        </div>
    );
}

export default CartModal;
